import React, {Component} from 'react'
import SingleSpell from './SingleSpell'
import {withCharacter} from './MyProvider'

class SingleSpellContainer extends Component {
    // componentDidMount(){
    //     this.props.getOneSpell()
    // }

    render(){
        const mappedSpell = this.props.spell.map(data => <SingleSpell spell={data.spell} type={data.type} effect={data.effect} />)
        return(
            <div className='singleSpellContainer'>
                {mappedSpell}
            </div>
        )
    }
}

export default withCharacter(SingleSpellContainer)
